import { defineConfig } from "checkly";

/**
 * See https://www.checklyhq.com/docs/cli/project-structure/
 */
const config = defineConfig({
  /* A human friendly name for your project */
  projectName: "unkey",
  /** A logical ID that needs to be unique across your Checkly account,
   * See https://www.checklyhq.com/docs/cli/constructs/ to learn more about logical IDs.
   */
  logicalId: "unkey",
  /* An optional URL to your Git repo */
  repoUrl: "https://github.com/unkeyed/unkey",
  /* Sets default values for Checks */
  checks: {
    /* A default for how often your Check should run in minutes */
    frequency: 10,
    /* Checkly data centers to run your Checks as monitors */
    locations: ["us-east-1", "eu-west-1"],
    /* An optional array of tags to organize your Checks */
    tags: ["mac"],
    /** The Checkly Runtime identifier, determining npm packages and the Node.js version available at runtime.
     * See https://www.checklyhq.com/docs/cli/npm-packages/
     */
    runtimeId: "2023.09",
    /* A glob pattern that matches the Checks inside your repo, see https://www.checklyhq.com/docs/cli/using-check-test-match/ */
    checkMatch: "**/__checks__/**/*.check.ts",
    /* Global configuration option for Playwright-powered checks. See https://docs/browser-checks/playwright-test/#global-configuration */
    browserChecks: {
      /* A glob pattern matches any Playwright .spec.ts files and automagically creates a Browser Check. This way, you
       * can just write native Playwright code. See https://www.checklyhq.com/docs/cli/using-check-test-match/
       * */
      testMatch: "**/__checks__/**/*.spec.ts",
    },
  },
  cli: {
    /* The default datacenter location to use when running npx checkly test */
    runLocation: "eu-west-1",
    /* An array of default reporters to use when a reporter is not specified with the "--reporter" flag */
    reporters: ["list"],
  },
});

export default config;

import type { KnipConfig } from "knip";

const config: KnipConfig = {
  ignoreWorkspaces: ["packages/nuxt"],
  ignoreDependencies: ["cz-conventional-changelog"],
  workspaces: {
    ".": {
      entry: "checkly.config.ts",
    },
    "apps/dashboard": {
      entry: ["lib/trpc/index.ts", "trpc.config.ts"],
    },
    "apps/api": {
      entry: ["**/*.test.ts", "src/pkg/testutil/*.ts", "src/worker.ts", "./vitest.*.ts"],
    },
    "internal/billing": {
      entry: ["src/index.ts", "**/*.test.ts"],
    },
    "internal/db": {
      entry: "src/index.ts",
    },
    "packages/rbac": {
      entry: ["src/index.ts", "**/*.test.ts"],
    },
    "internal/hash": {
      entry: ["src/index.ts", "**/*.test.ts"],
    },
    "internal/id": {
      entry: "src/index.ts",
    },
    "internal/keys": {
      entry: ["src/index.ts", "**/*.test.ts"],
    },
    "internal/resend": {
      entry: "src/index.ts",
    },
    "internal/vercel": {
      entry: "src/index.ts",
    },
    "packages/*": {
      entry: ["**/*.test.ts"],
    },
    "tools/bootstrap": {
      entry: "main.ts",
    },

    "tools/k6": {
      entry: "load.js",
    },
    "tools/migrate": {
      entry: "main.ts",
    },
  },
};

export default config;

{
  "$schema": "https://turborepo.org/schema.json",
  "tasks": {
    "install": {
      "outputs": ["node_modules/**", "pnpm-lock.yaml", "yarn.lock"]
    },
    "build": {
      "dependsOn": ["fmt", "^build"],
      "env": [
        "NEXT_PUBLIC_\\*",
        "\\!NEXT_PUBLIC_VERCEL_\\*",
        "AGENT_URL",
        "AGENT_TOKEN",
        "CLERK_WEBHOOK_SECRET",
        "CLERK_SECRET_KEY",
        "DATABASE_PASSWORD",
        "DATABASE_USERNAME",
        "DATABASE_HOST",
        "PLAIN_API_KEY",
        "QSTASH_CURRENT_SIGNING_KEY",
        "QSTASH_NEXT_SIGNING_KEY",
        "RESEND_AUDIENCE_ID",
        "RESEND_API_KEY",
        "SLACK_WEBHOOK_URL_SIGNUP",
        "STRIPE_PRODUCT_ID_ACTIVE_KEYS",
        "STRIPE_ACTIVE_KEYS_PRODUCT_ID",
        "STRIPE_PRODUCT_ID_KEY_VERIFICATIONS",
        "STRIPE_PRODUCT_ID_PRO_PLAN",
        "STRIPE_PRODUCT_ID_SUPPORT",
        "STRIPE_SECRET_KEY",
        "STRIPE_WEBHOOK_SECRET",
        "CLICKHOUSE_URL",
        "UNKEY_API_ID",
        "UNKEY_KEY_AUTH_ID",
        "UNKEY_WEBHOOK_KEYS_API_ID",
        "UNKEY_WORKSPACE_ID",
        "VERCEL_INTEGRATION_CLIENT_ID",
        "VERCEL_INTEGRATION_CLIENT_SECRET"
      ],
      "outputs": ["dist/**", ".output/**", ".nuxt/**", ".next/**", "!.next/cache/**"]
    },
    "@unkey/nuxt#dev:prepare": {
      "outputs": ["dist/**", "playground/.nuxt/**"]
    },
    "@unkey/nuxt#test": {
      "dependsOn": ["@unkey/api#build", "@unkey/nuxt#dev:prepare"],
      "outputs": []
    },
    "@unkey/nuxt#build": {
      "dependsOn": ["@unkey/nuxt#dev:prepare"]
    },
    "fmt": {
      "cache": false
    },
    "lint": {
      "cache": false
    },
    "dev": {
      "cache": false
    },
    "test": {
      "cache": false
    },
    "start": {
      "cache": false
    },
    "bootstrap": {
      "cache": false
    },
    "migrate": {
      "cache": false
    }
  }
}
